import * as types from "./Actions/actiontypes";

export default Reducers = (state = {}, action) => {
  switch (action.type) {
    case types.AUTHENTICATE:
      return Object.assign({}, state, {
        authToken: action.authToken
      });
    case types.CHANGE_ACTIVE_ROUTE:
      return Object.assign({}, state, {
        activeRoute: action.activeRoute
      });      
    case types.CONFIGURE_HOME_PAGE:
      return Object.assign({}, state, {
        homePage: action.homePage
      });      
    case types.DEAUTHENTICATE:
      return Object.assign({}, state, {
        authToken: null
      });
    case types.FORCE_IFRAME_RELOAD:
      return Object.assign({}, state, {
        iframeKey: state.iframeKey == "0" ? "1" : "0"
      });      
    case types.GET_ROUTES_SUCCESS:
      return Object.assign({}, state, {
        routes: action.routes
      });     
    case types.LOGGED_IN:
      return Object.assign({}, state, {
        loggedInFlag: action.loggedInFlag
      });       
    case types.MOST_RECENT_AND_VIEWED_REPORTS:
      return Object.assign({}, state, {
        mostRecentAndViewedReports: action.mostRecentAndViewedReports
      });      
    case types.SET_IS_SESSION_VALID:
      return Object.assign({}, state, {
        isSessionValid: action.isSessionValid
      });
    case types.SET_USERNAME:
      return Object.assign({}, state, {
        loggedInUsername: action.loggedInUsername
      });
    case types.SET_ACTION_IN_PROGRESS:
      return Object.assign({}, state, {
        actionInProgress: action.actionInProgress
      });
    case types.SET_MARKETPLACE_ROUTES:
      return Object.assign({}, state, {
        marketplaceRoutes: action.marketplaceRoutes
      });      
    case types.SET_USER:
      return Object.assign({}, state, {
        user: action.user
      });
    case types.SET_COOKIE_NOTICE_TOKEN:
      return Object.assign({}, state, {
        cookieNoticeToken: action.cookieNoticeToken
      });
    case types.SET_USER_ROUTES:
      return Object.assign({}, state, {
        userRoutes: action.userRoutes
      });
    case types.SET_PRODUCT_CATALOG:
      return Object.assign({}, state, {
        productCatalog: action.productCatalog
      });      
    case types.SET_PRODUCT_CONFIG:
      return Object.assign({}, state, {
        productConfig: action.productConfig
      });
    default:
      return state;
  }
};
